import React from 'react'

const Rating = ({ value }) => {
  let ans = value / 1
  let rem = value % 1
  console.log(ans)
  console.log(rem)
  let element
  let cnt = 0
  for (let i = 0; i < ans; i++) {
    cnt += 1
    element = (
      <span>
        <i className='fas fa-star'></i>
      </span>
    )
  }
  if (rem !== 0) {
    cnt += 1
    element += (
      <span>
        <i className='fas fa-star-half-alt'></i>
      </span>
    )
  }
  rem = 5 - cnt
  for (let i = 0; i < rem; i++) {
    element += (
      <span>
        <i className='far fa-star'></i>
      </span>
    )
  }

  return <div className='rating'>{element}</div>
}

export default Rating
